import React from 'react'
import styled from "styled-components"
import {Container, Button} from "react-bootstrap"


const FooterContainer = styled(Container)`
    display: flex;
    flex-direction: column;
    height: auto;
    align-items: stretch;
    margin: 0 0;
    padding: 0;
`

const FooterImageWrapper = styled.object`
    height: 100%;
    width: 100%;
`

export const Footer = () => {
    return (
        <>
        <FooterContainer>
            <FooterImageWrapper type="image/svg+xml" data="/assets/images/footer.svg"></FooterImageWrapper>
        </FooterContainer>

        </>
    )
}

export default Footer
